//----------------------------------------------------------------------------------------
function get($url)
{
	$data = null;
	
	$opts = array(
	  CURLOPT_URL =>$url,
	  CURLOPT_FOLLOWLOCATION => TRUE,
	  CURLOPT_RETURNTRANSFER => TRUE
	);
	
	$ch = curl_init();
	curl_setopt_array($ch, $opts);
	$data = curl_exec($ch);
	$info = curl_getinfo($ch); 
	curl_close($ch);
	
	return $data;
}

//----------------------------------------------------------------------------------------
// GBIF API
function get_occurrence($id)
{
	global $couch;

	$data = null;
	
	$url = 'https://api.gbif.org/v1/occurrence/' . $id;
	
	//echo $url . "\n";
	
	$json = get($url);
	
	//echo $json;
	
	if ($json != '')
	{
		$obj = json_decode($json);
		if ($obj)
		{
			$data = new stdclass;
			
			$data->_id = 'https://www.gbif.org/occurrence/' . $id;
			
			$data->{'message-format'} = 'application/json';
			
			// Set URL we got data from
			$data->{'message-source'} = $url;
						
			$data->message = $obj;
			



			
		}
	}
	
	return $data;
}


//----------------------------------------------------------------------------------------
function gbif_fetch($id)
{
	global $couch;
	global $force;
	
	$_id = 'https://www.gbif.org/occurrence/' . $id;
	
	$exists = $couch->exists($_id);

	$go = true;
	if ($exists && !$force)
	{
		echo "Have already\n";
		$go = false;
	}

	if ($go)
	{
		$doc = get_occurrence($id);
				
		if ($doc)
		{
		
			if (!$exists)
			{
				$couch->add_update_or_delete_document($doc, $doc->_id, 'add');	
			}
			else
			{
				if ($force)
				{
					$couch->add_update_or_delete_document($doc, $doc->_id, 'update');
				}
			}
		}
	}	
}


