	foreach ($species as $name)
	{
		$taxonKey = 0;
		
		$url = 'http://api.gbif.org/v1/species?name=' . urlencode($name) . '&datasetKey=' . $nub;

		echo $url . "\n";

		$json = get($url);

		//echo $json;

		$obj = json_decode($json);

		if (count($obj->results) == 1)
		{
			$taxonKey = $obj->results[0]->key;
		}	

		if ($taxonKey != 0)	
		{

			$url = 'https://api.gbif.org/v1/occurrence/search?taxonKey=' . $taxonKey;
	
			// images
			//$url .= '&mediaType=StillImage';
		
			// types
			//$url .= '&typeStatus=*';
			
			$types = array(
				'HOLOTYPE',
				'PARATYPE',
				'ISOTYPE',
				'LECTOTYPE');
				
			foreach ($types as $type)
			{
				$url .= '&typeStatus=' . $type;
			}
		
		
			echo $url;
	
			$json = get($url);
		
			echo $json;
		
			if ($json != '')
			{
				$obj = json_decode($json);
		
				$ids = array();
		
				if (isset($obj->results))
				{		
					foreach ($obj->results as $result)
					{
						$ids[] = $result->key;
					}
				}
			
				foreach ($ids as $id)
				{
					gbif_fetch($id);
				}			
			
			}
		}
	}
